'use strict';
class ClosePositionDescriptor {
    buySell;
    clientRate;
    parties;
    pointSize;
    offerId;
    getBuySell() {
        return this.buySell;
    }
    getClientRate() {
        return this.clientRate;
    }
    getParties() {
        return this.parties;
    }
    getPointSize() {
        return this.pointSize;
    }
    getOfferId() {
        return this.offerId;
    }
    static create(buySell, clientRate, parties, pointSize, offerId) {
        let instance;
        instance = new ClosePositionDescriptor();
        instance.buySell = buySell;
        instance.clientRate = clientRate;
        instance.parties = parties;
        instance.pointSize = pointSize;
        instance.offerId = offerId;
        return instance;
    }
}
module.exports = ClosePositionDescriptor
